/*Table structure for table `od_customer` */

DROP TABLE IF EXISTS `od_customer`;

CREATE TABLE `od_customer` (
  `customerid` varchar(40) NOT NULL COMMENT '客户信息ID',
  `orderid` varchar(40) NOT NULL COMMENT '订单ID',
  `ordercode` varchar(40) NOT NULL COMMENT '订单编号',
  `name` varchar(200) NOT NULL COMMENT '客户姓名',
  `sex` varchar(20) DEFAULT NULL COMMENT '性别',
  `tele` varchar(20) NOT NULL COMMENT '手机号码',
