/*Table structure for table `od_order` */

DROP TABLE IF EXISTS `od_order`;

CREATE TABLE `od_order` (
  `orderid` varchar(40) NOT NULL COMMENT '订单ID',
  `ordercode` varchar(40) NOT NULL COMMENT '订单编号',
  `itemid` varchar(40) NOT NULL COMMENT '项目ID',
  `sessionsid` varchar(40) NOT NULL COMMENT '场次ID',
  `venueid` varchar(40) NOT NULL COMMENT '场馆ID',
  `hallid` varchar(40) NOT NULL COMMENT '演出厅ID',
  `producttypeid` varchar(40) NOT NULL COMMENT '产品类别ID',
  `odtime` varchar(30) NOT NULL COMMENT '订单时间',
  `locktime` varchar(30) NOT NULL COMMENT '锁票时间',
  `unlocktime` varchar(30) DEFAULT NULL COMMENT '释放时间',
  `outtime` varchar(30) DEFAULT NULL COMMENT '出票时间',
  `numb` decimal(10,0) NOT NULL COMMENT '总张数',
  `policyid` varchar(40) DEFAULT NULL COMMENT '销售政策ID',
  `totalprice` decimal(10,2) DEFAULT NULL COMMENT '原订单总金额',
  `policyprice` decimal(10,2) DEFAULT NULL COMMENT '优惠金额',
  `actprice` decimal(10,2) DEFAULT NULL COMMENT '实际得到总金额',
  `paytime` varchar(30) DEFAULT NULL COMMENT '支付时间',
  `paytype` varchar(20) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '支付方式',
  `payprice` decimal(10,2) DEFAULT NULL COMMENT '支付金额',
  `payboxid` varchar(40) NOT NULL COMMENT '售票机构ID',
  `sellerid` varchar(40) NOT NULL COMMENT '售票员ID',
  `isoutlet` varchar(10) DEFAULT NULL COMMENT '是否取票',
  `outlettime` varchar(30) DEFAULT NULL COMMENT '取票时间',
  `odtype` varchar(10) NOT NULL COMMENT '订单类型',
  `odstatus` varchar(10) NOT NULL COMMENT '订单状态',
  `paystatus` varchar(10) NOT NULL COMMENT '支付状态',
  `outstatus` varchar(10) NOT NULL COMMENT '出票状态',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`orderid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单\r\n订单时间：预订的订单则为预订时间\r\n是否取票：1是 2否，默认为1，预订的默认为2\r\n                             -&#';

