/*Table structure for table `od_orderop` */

DROP TABLE IF EXISTS `od_orderop`;

CREATE TABLE `od_orderop` (
  `orderopid` varchar(40) NOT NULL COMMENT '订单操作明细ID',
  `orderid` varchar(40) NOT NULL COMMENT '订单ID',
  `userid` varchar(40) NOT NULL COMMENT '操作用户ID',
  `optype` varchar(10) DEFAULT NULL COMMENT '操作类型',
  `optime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '操作时间',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`orderopid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单操作明细\r\n操作类型:\r\n1锁票 2预订 3退票 4支付 5退款 6出票 7取消';

