/*Table structure for table `od_reprint` */

DROP TABLE IF EXISTS `od_reprint`;

CREATE TABLE `od_reprint` (
  `reprintid` varchar(40) NOT NULL COMMENT '重打ID',
  `orderid` varchar(40) NOT NULL COMMENT '订单ID',
  `ordercode` varchar(40) NOT NULL COMMENT '订单编号',
  `detailid` varchar(40) NOT NULL COMMENT '订单明细ID',
  `applyid` varchar(40) NOT NULL COMMENT '申请人',
  `applytime` varchar(30) NOT NULL COMMENT '申请时间',
  `auditid` varchar(40) DEFAULT NULL COMMENT '审核人',
  `audittime` varchar(30) DEFAULT NULL COMMENT '审核时间',
  `restatus` varchar(10) NOT NULL COMMENT '重打状态',
  `isreprint` varchar(10) NOT NULL COMMENT '重打标记',
  `des` varchar(3600) DEFAULT NULL,
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`reprintid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='重打记录表\r\n重打状态：1待审核 2审核通过 3审核未通过\r\n重打标记：1未重打 2已重打';

