/*Table structure for table `pt_area` */

DROP TABLE IF EXISTS `pt_area`;

CREATE TABLE `pt_area` (
  `areaid` varchar(40) NOT NULL COMMENT '行政区划ID',
  `areaname` varchar(200) DEFAULT NULL COMMENT '行政区划名称',
  `spell` varchar(100) DEFAULT NULL COMMENT '姓名拼音',
  `fareaid` varchar(40) NOT NULL COMMENT '上级行政区划ID',
