/*Table structure for table `pt_dict` */

DROP TABLE IF EXISTS `pt_dict`;

CREATE TABLE `pt_dict` (
  `dictid` varchar(40) NOT NULL COMMENT '代码ID',
  `dvalue` varchar(200) NOT NULL COMMENT '值',
  `dicttypeid` varchar(40) NOT NULL COMMENT '代码分类ID',
  `pxh` varchar(10) NOT NULL COMMENT '排序号',
  `des` varchar(600) NOT NULL COMMENT '说明',
  `status` varchar(10) DEFAULT '1' COMMENT '禁启状态',
  `delstatus` varchar(10) DEFAULT NULL COMMENT '删除状态',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`dictid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='代码表\r\n禁启状态：1启用 2禁用';

