/*Table structure for table `pt_item` */

DROP TABLE IF EXISTS `pt_item`;

CREATE TABLE `pt_item` (
  `itemid` int(11) NOT NULL AUTO_INCREMENT COMMENT '项目ID',
  `itemname` varchar(200) NOT NULL COMMENT '项目名称',
  `producttypeid` varchar(20) DEFAULT NULL COMMENT '项目类型(产品类型id)',
  `introduction` longtext COMMENT '项目介绍',
  `venueid` varchar(30) DEFAULT NULL COMMENT '场馆id',
  `sel_status` varchar(10) DEFAULT NULL COMMENT '售票状态 1-预售 2-已售 3-停售',
  `starttime` date DEFAULT NULL COMMENT '开始时间',
  `endtime` date DEFAULT NULL COMMENT '结束时间',
  `image_path_arr` varchar(1000) DEFAULT NULL COMMENT '图片路径数组',
  `vedio_path_arr` varchar(1000) DEFAULT NULL COMMENT '视频路径数组',
  `status` varchar(10) NOT NULL DEFAULT '1' COMMENT '启用状态 0-禁用 1-启用',
  `delstatus` varchar(10) NOT NULL DEFAULT '0' COMMENT '删除状态 0-未删除 1-已删除',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` datetime DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`itemid`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='项目管理';

