/*Table structure for table `pt_role` */

DROP TABLE IF EXISTS `pt_role`;

CREATE TABLE `pt_role` (
  `roleid` int(8) NOT NULL AUTO_INCREMENT COMMENT '平台角色ID',
  `rolename` varchar(60) NOT NULL COMMENT '角色名称',
