/*Table structure for table `pt_sellpower` */

DROP TABLE IF EXISTS `pt_sellpower`;

CREATE TABLE `pt_sellpower` (
  `sellpowerid` varchar(40) NOT NULL COMMENT '售票权限ID',
  `powername` varchar(200) NOT NULL COMMENT '权限名称',
  `characteristic` varchar(200) DEFAULT NULL COMMENT '权限唯一标识',
  `pxh` varchar(40) DEFAULT NULL COMMENT '排序号',
  `des` varchar(600) DEFAULT NULL COMMENT '说明',
  `status` varchar(10) DEFAULT NULL COMMENT '禁启状态',
  `delstatus` varchar(10) DEFAULT NULL COMMENT '删除状态',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`sellpowerid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='售票权限\r\n如：售票、预售、取票';

