/*Table structure for table `pt_sessions` */

DROP TABLE IF EXISTS `pt_sessions`;

CREATE TABLE `pt_sessions` (
  `sessionsid` varchar(40) NOT NULL COMMENT '场次ID',
  `venueid` varchar(40) NOT NULL COMMENT '场馆ID',
  `hallid` varchar(40) NOT NULL COMMENT '演出厅ID',
  `performerid` varchar(40) NOT NULL COMMENT '演出商ID(已废除)',
  `itemid` varchar(40) NOT NULL COMMENT '项目ID',
  `sessionscode` varchar(40) NOT NULL COMMENT '场次编号',
  `sessionsname` varchar(200) NOT NULL COMMENT '场次名称',
  `ticketfaceid` varchar(40) DEFAULT NULL COMMENT '票样id',
  `engname` varchar(200) DEFAULT NULL COMMENT '场次英文名(已废除)',
  `playtime` timestamp NULL DEFAULT NULL COMMENT '上演时间',
  `length` varchar(100) DEFAULT NULL COMMENT '片长',
  `begintime` timestamp NULL DEFAULT NULL COMMENT '售票开始时间',
  `endtime` timestamp NULL DEFAULT NULL COMMENT '售票截止时间',
  `producttypeid` varchar(40) DEFAULT NULL COMMENT '产品类别ID(已废除)',
  `sponsor` varchar(200) DEFAULT NULL COMMENT '主办方(已废除)',
  `dessponsor` varchar(200) DEFAULT NULL COMMENT '指定主办方(已废除)',
  `actualsponsor` varchar(200) DEFAULT NULL COMMENT '承办方(已废除)',
  `website` varchar(200) DEFAULT NULL COMMENT '网址(已废除)',
  `checktimes` varchar(40) DEFAULT NULL COMMENT '检票次数(已废除)',
  `regnumb` varchar(100) DEFAULT NULL COMMENT '税号登记(已废除)',
  `introduction` varchar(600) DEFAULT NULL COMMENT '场次介绍(已废除)',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '场次状态 0-禁用 1-启用',
  `delstatus` int(11) NOT NULL DEFAULT '0' COMMENT '删除状态 0-未删除 1-已删除',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号(已废除)',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`sessionsid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='场次信息';

