/*Table structure for table `pt_sessionsquota` */

DROP TABLE IF EXISTS `pt_sessionsquota`;

CREATE TABLE `pt_sessionsquota` (
  `squotaid` varchar(40) NOT NULL COMMENT '场次配额ID',
  `sessionsid` varchar(40) NOT NULL COMMENT '场次ID',
  `quata` decimal(10,2) NOT NULL COMMENT '场次剩余金额',
  PRIMARY KEY (`squotaid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='场次配额设置\r\n场次剩余金额：即所有机构的配额设置总和不能高于该值，该值不能高于可售票票价总额';

