/*Table structure for table `pt_sessnpew` */

DROP TABLE IF EXISTS `pt_sessnpew`;

CREATE TABLE `pt_sessnpew` (
  `pewid` varchar(40) NOT NULL COMMENT '座位ID',
  `sessionsid` varchar(40) NOT NULL COMMENT '场次ID',
  `hallid` varchar(40) NOT NULL COMMENT '演出厅ID',
  `zoneid` varchar(40) NOT NULL COMMENT '分区ID',
  `pewname` varchar(200) DEFAULT NULL COMMENT '座位名',
  `pxh` int(10) DEFAULT NULL,
  `row` varchar(10) DEFAULT NULL COMMENT '排号',
  `col` varchar(10) DEFAULT NULL COMMENT '列号',
  `isaddpew` varchar(10) DEFAULT NULL COMMENT '是否加座',
  `pricelevelid` varchar(40) DEFAULT NULL COMMENT '票价等级ID',
  `price` decimal(10,2) DEFAULT NULL COMMENT '票价',
  `reserveid` varchar(40) DEFAULT NULL COMMENT '预留分类ID',
  `ispresell` varchar(10) DEFAULT NULL COMMENT '是否可预售',
  `issale` varchar(10) DEFAULT NULL COMMENT '是否可售',
  `iscancel` varchar(10) DEFAULT NULL COMMENT '是否可取',
  `remark` varchar(600) DEFAULT NULL COMMENT '备注',
  `pewstatus` varchar(10) DEFAULT NULL COMMENT '座位状态',
  `status` varchar(10) DEFAULT NULL COMMENT '禁启状态',
  `delstatus` varchar(10) DEFAULT NULL COMMENT '删除状态',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`pewid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='座位\r\n票价划分：指定座位价格\r\n座位预留：指定座位预留类别';

