/*Table structure for table `pt_sessnzone` */

DROP TABLE IF EXISTS `pt_sessnzone`;

CREATE TABLE `pt_sessnzone` (
  `sessnzoneid` varchar(40) NOT NULL COMMENT '场次分区ID',
  `sessionsid` varchar(40) NOT NULL COMMENT '场次ID',
  `hallid` varchar(40) NOT NULL COMMENT '演出厅ID',
  `zonename` varchar(200) NOT NULL COMMENT '分区名称',
  `addr` varchar(600) DEFAULT NULL COMMENT '地址',
  `pewpic` varchar(200) DEFAULT NULL COMMENT '所属座位图',
  `rule` varchar(200) DEFAULT NULL COMMENT '分区规则',
  `height` decimal(10,2) DEFAULT NULL COMMENT '高',
  `width` decimal(10,2) DEFAULT NULL COMMENT '宽',
  `rownum` decimal(10,0) DEFAULT NULL COMMENT '座位行数',
  `colnum` decimal(10,0) DEFAULT NULL COMMENT '座位列数',
  `x` decimal(10,2) DEFAULT NULL COMMENT 'x坐标',
  `y` decimal(10,2) DEFAULT NULL COMMENT 'y坐标',
  `text` varchar(200) DEFAULT NULL COMMENT '分区文字',
  `color` varchar(100) DEFAULT NULL COMMENT '分区颜色值',
  `tpurl` varchar(200) DEFAULT NULL COMMENT '分区图片URL',
  `zonetype` varchar(10) DEFAULT NULL COMMENT '分区类型',
  `des` varchar(600) DEFAULT NULL COMMENT '分区描述',
  `remark` varchar(600) DEFAULT NULL COMMENT '备注',
  `status` varchar(10) DEFAULT NULL COMMENT '禁启状态',
  `delstatus` varchar(10) DEFAULT NULL COMMENT '删除状态',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`sessnzoneid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='分区';

