/*Table structure for table `pt_setpolicy` */

DROP TABLE IF EXISTS `pt_setpolicy`;

CREATE TABLE `pt_setpolicy` (
  `setpolicyid` varchar(40) NOT NULL COMMENT '优惠政策id',
  `sessionsid` varchar(40) NOT NULL COMMENT '场次id',
  `policyname` varchar(200) NOT NULL COMMENT '优惠名称',
  `pricelevelid` varchar(40) DEFAULT NULL COMMENT '票价等级',
  `numb` int(11) DEFAULT NULL COMMENT '数量',
  `totalprice` decimal(10,2) DEFAULT NULL COMMENT '总价',
  `des` varchar(600) DEFAULT NULL,
  `setshow` varchar(10) DEFAULT NULL COMMENT '票面显示的指定文字',
  `charshow` varchar(10) DEFAULT NULL,
  `begintime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `endtime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `cid` varchar(40) DEFAULT NULL,
  `ctime` varchar(40) DEFAULT NULL,
  `mid` varchar(40) DEFAULT NULL,
  `mtime` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`setpolicyid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

