/*Table structure for table `pt_ticketface` */

DROP TABLE IF EXISTS `pt_ticketface`;

CREATE TABLE `pt_ticketface` (
  `ticketfaceid` varchar(40) NOT NULL COMMENT '票版ID',
  `venueid` int(11) DEFAULT NULL COMMENT '场馆id',
  `sessionsid` varchar(40) NOT NULL COMMENT '场次ID(已废除)',
  `ticketcode` varchar(40) NOT NULL COMMENT '票面编号(已废除)',
  `ticketname` varchar(200) NOT NULL COMMENT '票面名称',
  `ticketorient` varchar(100) DEFAULT NULL COMMENT '票面方向(已废除)',
  `bgurl` varchar(200) DEFAULT NULL COMMENT '票面背景图URL',
  `height` decimal(10,2) DEFAULT NULL COMMENT '高度',
  `width` decimal(10,2) DEFAULT NULL COMMENT '宽度',
  `content` longtext COMMENT '保存了票面样式的div',
  `carbonlocation` varchar(200) DEFAULT NULL COMMENT '副劵位置(已废除)',
  `carbonnum` decimal(10,0) DEFAULT NULL COMMENT '副劵数量(已废除)',
  `carbonheight` decimal(10,2) DEFAULT NULL COMMENT '副劵高度cm(已废除)',
  `cid` varchar(40) DEFAULT NULL,
  `ctime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `mid` varchar(40) DEFAULT NULL,
  `mtime` datetime DEFAULT NULL,
  PRIMARY KEY (`ticketfaceid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='票版\r\n生成票版：将票价制定、票价划分、票面、售票权限、预留、销售政策均生成数据（空白和复制都生成，复制时，可';

