/*Table structure for table `pt_ticketpic` */

DROP TABLE IF EXISTS `pt_ticketpic`;

CREATE TABLE `pt_ticketpic` (
  `ticketpicid` varchar(40) NOT NULL COMMENT '票面底图ID',
  `picname` varchar(200) NOT NULL COMMENT '图片名称',
  `tpurl` varchar(200) NOT NULL COMMENT '图片URL',
  `length` decimal(10,2) DEFAULT NULL COMMENT '长度',
  `width` decimal(10,2) DEFAULT NULL COMMENT '宽度',
  `des` varchar(600) DEFAULT NULL COMMENT '说明',
  `status` varchar(10) DEFAULT NULL COMMENT '禁启状态',
  `delstatus` varchar(10) DEFAULT NULL COMMENT '删除状态',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`ticketpicid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='票面底图';

/*Data for the table `pt_ticketpic` */

/*Table structure for table `pt_ticketprice` */

DROP TABLE IF EXISTS `pt_ticketprice`;

CREATE TABLE `pt_ticketprice` (
  `sessntkprid` varchar(40) NOT NULL COMMENT '场次票价ID',
  `sessionsid` varchar(40) NOT NULL COMMENT '场次ID',
  `pricelevelid` varchar(40) NOT NULL COMMENT '票价等级ID',
  `pricelevelname` varchar(200) DEFAULT NULL COMMENT '票价等级名称',
  `color` varchar(200) DEFAULT NULL COMMENT '票价等级颜色值',
  `price` decimal(10,2) NOT NULL COMMENT '票价',
  `mark` varchar(200) DEFAULT NULL COMMENT '票价标记（VIP字样）',
  `delstatus` varchar(10) DEFAULT NULL COMMENT '删除状态',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`sessntkprid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='票价制定';

