/*Table structure for table `pt_user` */

DROP TABLE IF EXISTS `pt_user`;

CREATE TABLE `pt_user` (
  `userid` int(8) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `username` varchar(40) NOT NULL COMMENT '登录账号',
  `pass` varchar(50) NOT NULL COMMENT '登录密码(加密串)',
  `realname` varchar(60) NOT NULL COMMENT '真实姓名',
  `spell` varchar(100) DEFAULT NULL COMMENT '姓名拼音',
  `sex` varchar(10) DEFAULT NULL COMMENT '性别',
  `age` decimal(10,0) DEFAULT NULL COMMENT '年龄',
  `telephone` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(200) DEFAULT NULL COMMENT '邮箱',
  `addr` varchar(200) DEFAULT NULL COMMENT '住址',
  `xzqh` varchar(20) DEFAULT NULL COMMENT '所在地区',
  `lasttime` varchar(30) DEFAULT NULL COMMENT '最后一次登录时间',
  `lastip` varchar(60) DEFAULT NULL COMMENT '最后一次登录IP',
  `times` decimal(10,0) DEFAULT NULL COMMENT '登录次数',
  `yhjf` decimal(10,0) DEFAULT NULL COMMENT '用户积分',
  `yhye` decimal(10,0) DEFAULT NULL COMMENT '用户余额',
  `status` varchar(10) NOT NULL DEFAULT '1' COMMENT '禁启状态',
  `delstatus` varchar(10) DEFAULT '3' COMMENT '删除状态',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(20) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(20) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  `roleid` int(8) DEFAULT NULL,
  `IdentifyNo` varchar(18) DEFAULT NULL COMMENT '身份证号码',
  PRIMARY KEY (`userid`)
