/*Table structure for table `pt_user_extend` */

DROP TABLE IF EXISTS `pt_user_extend`;

CREATE TABLE `pt_user_extend` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(32) DEFAULT NULL COMMENT '用户ID',
  `openid` varchar(32) DEFAULT NULL COMMENT '开放ID',
  `provider` int(11) DEFAULT '3' COMMENT '0:qq,1:微博,2:支付宝,3:微信',
  `nick` varchar(32) DEFAULT NULL COMMENT '昵称',
  `logo` varchar(256) DEFAULT NULL COMMENT '头像',
  `access_token` varchar(128) DEFAULT NULL COMMENT '访问令牌',
  `refresh_token` varchar(128) DEFAULT NULL COMMENT '刷新令牌',
  `ctime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

