/*Table structure for table `pt_user_role` */

DROP TABLE IF EXISTS `pt_user_role`;

CREATE TABLE `pt_user_role` (
  `urid` varchar(40) NOT NULL COMMENT '用户角色ID',
  `userid` varchar(40) NOT NULL COMMENT '用户ID',
  `roleid` varchar(40) NOT NULL COMMENT '角色ID',
  `delstatus` varchar(10) DEFAULT '3' COMMENT '删除状态',
