/*Table structure for table `pt_venue` */

DROP TABLE IF EXISTS `pt_venue`;

CREATE TABLE `pt_venue` (
  `venueid` int(11) NOT NULL AUTO_INCREMENT COMMENT '场馆ID',
  `venuename` varchar(200) NOT NULL COMMENT '场馆名称',
  `address` varchar(200) NOT NULL COMMENT '地址',
  `areaid` varchar(10) DEFAULT NULL COMMENT '所在地区',
  `introduction` varchar(600) DEFAULT NULL COMMENT '介绍',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '禁启状态 0-禁用  1-启用',
  `delstatus` int(11) NOT NULL DEFAULT '0' COMMENT '删除状态 0-未删除 1-已删除',
  `vid` decimal(10,0) DEFAULT NULL COMMENT '数据版本号',
  `cid` varchar(40) DEFAULT NULL COMMENT '创建人',
  `ctime` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `mid` varchar(40) DEFAULT NULL COMMENT '修改人',
  `mtime` varchar(30) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`venueid`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='场馆\r\n禁启状态：1启用  2禁用';

